sys_variable_value.value:
    (function execute(inputs, outputs) {
// ... code ...
var obj=JSON.parse(inputs.requestBody);
if(inputs.rider.product.coverDetails.riderDetails.length>0){
    obj.body.rider=[];
    var arr=[]
    inputs.rider.product.coverDetails.riderDetails.forEach(function(element){
        var obj={};
        obj={
"sumAssured":element.riderSumAssured,
"pptopt":element.riderPremiumPolicyTermOption,
"ppt":element.riderPremiumPolicyTerm,
"name":element.riderCoverCode,
"term":element.riderPolicyterm
        }
arr.push(obj);

    })
   
}
 obj.body.rider=arr;
 outputs.response=obj;
})(inputs, outputs);

